var Tests;(function(){describe("console service",function(){var n;beforeEach(function(){module("app")}),beforeEach(function(){inject(function(t){n=t})}),describe("given an instance of the console service when it is first called",function(){it("then should initialize the lines array to an empty list",function(){expect(n.lines).toBeDefined(),expect(n.lines.length).toBe(0)})}),describe("given an instance of the console service when the log method is called",function(){var t="This is a test message.";beforeEach(function(){n.log(t)}),it("then should add the message to the lines array",function(){expect(n.lines).toBeDefined(),expect(n.lines.length).toBe(1),expect(n.lines[0]).toBe(t)})}),describe("given an instance of the console service when the log method is called more than "+Constants.Display.ConsoleLines+" times",function(){var t=1..toString(16);beforeEach(function(){for(var t=0;t<=Constants.Display.ConsoleLines;t++)n.log(t.toString(16))}),it("then should truncate the the list to "+Constants.Display.ConsoleLines+" lines",function(){expect(n.lines.length).toBe(Constants.Display.ConsoleLines),expect(n.lines[0]).toBe(t)})})})})(Tests||(Tests={}))